def search_text(df,col,word,ini,fin):
    text_search=[]
    for i in df[col]:
        pos=i.find(word)
        if pos>=0:
            if pos<=ini:
                text_search.append((ini-pos)*' '+i[:pos+fin])
            else:
                text_search.append(i[pos-ini:pos+fin])
    return text_search

